import React from "react";

const TaskTableComponent = () => {
  return (
    <table>
      <theader>
        <th>Titulo</th>
        <th>Descripcion</th>
        <th>Estado</th>
      </theader>
      <tbody>
        <p>listado de tareas</p>
      </tbody>
    </table>
  );
};

export default TaskTableComponent;
